Engine实现.html.body:
Engine实现
本示例通过实现“SrcEngine”、“DestEngine”、“FrameworkerEngine”这三个Engine来实现resnet-18网络的数据串联。

SrcEngine：读取发送BGR二进制文件。
FrameworkerEngine：调用resnet-18网络模型进行计算，并输出结果给DestEngine。
DestEngine：保存生成的结果文件。

代码运行示例如图1所示。
图 1  代码运行示例

 说明：本节介绍代码实现说明，运行此样例工程不需要进行实现代码的修改。  

Engine实现类的Process函数可以将具体需要实现的功能封装在其中。
数据流通过以下方式在Engine间进行传输。
