        HIGH    =3;   
    }
    Frequency frequency = 9;// 保留字段
    enum DeviceType  // 保留字段
    {
        NPU  = 0;   
        IPU  = 1;   
        MLU  = 2;   
        CPU  = 3;
        NONE = 255;
    }
    DeviceType device_type = 10;// 保留字段
